<script setup>

//IMPORT

import { useCounterStore } from '@/stores/counter'

import { ref, onMounted, onBeforeUnmount, computed, watch  } from 'vue';



//DATA
const store = useCounterStore()

const route = useRoute()

const windowsHeight = ref(null)

const infoContainer = ref(null)

const heroImgWrapper = ref(null)

const heroSec = ref(null)

const partnerSec = ref(null)

const partnerSecBg = ref(null)

const partnerSecContent = ref(null)

const homeServicesSec = ref(null)

const scrollPosition = ref(null)

const heroBannerSec = ref(null)

const heroBannerSecMobActiv = ref(false)

const screenWidth = ref(0)

const { data: pageData } = await useFetch(`${store.serverUrlDomainRequest}/wp-json/wp/v2/pages?slug=home`)

console.log('pageData', pageData)



//METHODS 

//open form popup 
function openFormPopup(){
    store.changeTrigerButtonForm('Кнопка внизу страницы ')
    store.changePopupCurrent('popup-form')
}

//banner gallery
const swiperHerroBanner = useSwiper(heroBannerSec, {
   loop: true,
slidesPerView: "auto",
   spaceBetween: 10,   
   speed: 4000,
// breakpoints: {
//     250: {
//       slidesPerView: "auto",
//       spaceBetween: 30,
//     },
//     750: {
//       slidesPerView: "auto",
//       spaceBetween: 30,
//     },
//     950: {
//       slidesPerView: "auto",
//       spaceBetween: 30,
   
//     },

//   }

})

//hero sec anim show
function setCurrentHeroImgHeight(){
    let heroSecHeight = heroSec.value.clientHeight
    let heightTextBlock = infoContainer.value.clientHeight

    heroImgWrapper.value.style.height = `${heroSecHeight - heightTextBlock - 30}px`
 
    heroImgWrapper.value.classList.add('home-hero-sec__image-wrapper--activ')

    // console.log(heightTextBlock)
}


//scroll start script
function firstLoadScollScripts(){
    scrollPosition.value = window.scrollY
    parntersSecAnimV1()

    window.addEventListener('scroll', handleScroll);
    
}


function handleScroll(){
    scrollPosition.value = window.scrollY
    parntersSecAnimV1()
    parntersSecAnimV2()

    // console.log('scroll value', scrollPosition.value)
}


//partner anim sec 2
function parntersSecAnimV1(){
    let currentProcent = null
    let culcScaleValue = 0
    let finishScaleValue = null

    if(scrollPosition.value < 100){
        currentProcent = 0
        partnerSecBg.value.classList.remove('home-partner-sec__bg--activ')
    }

    if(scrollPosition.value >= 100 && scrollPosition.value < (windowsHeight.value / 100) * 65 ){
        let currentValue = scrollPosition.value - 100
        let fullSecScrollTrack = ((windowsHeight.value / 100) * 65) - 100 

        currentProcent = (currentValue / fullSecScrollTrack) * 100
        console.log('fullSecScrollTrack', fullSecScrollTrack)

        partnerSecBg.value.classList.remove('home-partner-sec__bg--activ')
        
    }

    if(scrollPosition.value > (windowsHeight.value / 100) * 65 ){
        currentProcent = 100
        partnerSecBg.value.classList.add('home-partner-sec__bg--activ')
      
    }


    if (window.matchMedia('(max-width: 750px)').matches) {
        culcScaleValue = (0.15 * currentProcent) / 100
        finishScaleValue = 0.85 + culcScaleValue
    } else {
        culcScaleValue = (0.3 * currentProcent) / 100
        finishScaleValue = 0.7 + culcScaleValue
    }

    
    
    partnerSecBg.value.style.transform = `scale(${finishScaleValue})`

    // console.log('currentProcent', currentProcent)
    // console.log(windowsHeight.value, (windowsHeight.value / 100) * 65 )
}


function parntersSecAnimV2(){

    let currentProcent = null
    let culcScaleValue = 0

    if(scrollPosition.value < windowsHeight.value){
        currentProcent = 0
    }

    if(scrollPosition.value >= windowsHeight.value && scrollPosition.value <= windowsHeight.value * 3){
        let currentValue = scrollPosition.value - windowsHeight.value
        let fullSecScrollTrack = (windowsHeight.value * 3) - windowsHeight.value

        currentProcent = (currentValue / fullSecScrollTrack) * 100
    }

    if(scrollPosition.value > windowsHeight.value * 3){
        currentProcent = 100
    }


    culcScaleValue = 1 - (currentProcent / 100)

    partnerSecContent.value.style.transform = `scale(${culcScaleValue})`
    
    // console.log('parntersSecAnimV2 currentProcent', currentProcent)
}


const handleResize = () => {
  screenWidth.value = window.innerWidth
}

const onSlider = () => {
  console.log('Ширина меньше 1200 — вызываем метод')
  heroBannerSecMobActiv.value = true
}






//HOOKS
onMounted(() => {
    windowsHeight.value = heroSec.value.clientHeight
    setCurrentHeroImgHeight()
    firstLoadScollScripts()

     handleResize()
  window.addEventListener('resize', handleResize)

   
});

onBeforeUnmount(() => {
    window.removeEventListener('scroll', handleScroll);
});

watchEffect(() => {
  if (screenWidth.value < 1200) {
    onSlider()
  }
  else{
     heroBannerSecMobActiv.value = false
  }
})



//SEO
useHead({
    title: pageData.value[0].acf.seo_title || pageData.value[0].title.rendered,
    meta: [
        // Description
        { name: 'description', content: pageData.value[0].acf.seo_description || 'Описание по умолчанию' },

        // Keywords (опционально, не влияет сильно на SEO)
        { name: 'keywords',  content: pageData.value[0].acf.klyuchevaya_fraza || 'test' },

        // OpenGraph
        { property: 'og:title', content: pageData.value[0].acf.seo_title },
        { property: 'og:description', content: pageData.value[0].acf.seo_description },
        { property: 'og:type', content: 'website' },
        { property: 'og:url', content: `${store.domainUrlCurrent}${route.fullPath}` },
        { property: 'og:image', content: pageData.value?.[0]?.acf?.og_image?.url || 'http://syberia.gearsdpz.beget.tech/wp-content/uploads/2025/07/87baa9efe5d849e4f8da67fe01f9e029.jpg' },

        // Twitter Card (если используешь)
        { name: 'twitter:card', content: 'summary_large_image' },
        { name: 'twitter:title', content: pageData.value[0].acf.seo_title },
        { name: 'twitter:description', content: pageData.value[0].acf.seo_description },
        { name: 'twitter:image', content: pageData.value?.[0]?.acf?.og_image?.url || 'http://syberia.gearsdpz.beget.tech/wp-content/uploads/2025/07/87baa9efe5d849e4f8da67fe01f9e029.jpg' },

        // Индексация / Деиндексация
        // Например, noindex для черновика:
        {
        name: 'robots',
        content:
            pageData.value[0].acf.indeksacziya_v_poiskovyh_sistemah === 'index'
            ? 'index, follow'
            : 'noindex, nofollow'
        }
    ],
    link: [
        // Canonical (вручную или динамически)
        { rel: 'canonical', href: `${store.domainUrlCurrent}/${pageData.value[0].acf.canonical || route.name}` }
    ]
})
  
</script>

